description:
Kyaa Super Kool Hain Hum (English: How Super Cool Are We) is a 2012 Bollywood comedy film directed by Sachin Yardi, and produced by Ekta Kapoor and Shobha Kapoor. The film is a sequel to the 2005 sleeper hit, Kyaa Kool Hai Hum. The movie stars Tusshar Kapoor and Ritesh Deshmukh from the original cast. Made on a low budget, the film received very good response at the box office and was declared a &quot;semihit&quot; by Boxofficeindia.

